  [],\n\t\"revision_timestamp\": \"2016-02-26T22:14:37.688015\",\n\t\"name\": \"afsc-race-sap-swiney-red-king-crab-fecundity-and-embryo-and-larval-quality-5646b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Stock assessment of Alaskan red king crab,
  Paralithodes camtschaticus (Tilesius, 1815), can be improved by incorporating reproductive
  output, which requires an understanding of the size-fecundity relationship, interannual
  and seasonal variability in fecundity, and maternal size effects on embryo and larval
  quality.  We collected red king crab egg clutches from Bristol Bay, Alaska, in summer
  of 2007-2010 and autumn of 2007-2009 and estimated fecundity.  A monitoring project
  examining  the size-fecundity relationship began in 2012 and data is collected every
  other year.In June 2009 and 2010 we collected embryo clutches of recently extruded
  red king crab embryos in Bristol Bay, Alaska, to assess embryo quality based on
  dry weight, carbon and nitrogen content.  To assess larval quality, we collected
  ovigerous females from Bristol Bay in 2007 and reared them in the laboratory until
  larval hatching in 2008.  Larval quality based on dry weight, carbon and nitrogen
  content, and time to 50% mortality under starvation conditions was assessed.\",\n\t\"license_title\":
